import React, { useEffect } from "react";
import styles from "../styles/StudentList.module.css";
import { useSelector, useDispatch } from "react-redux";
import { getUserList } from "../features/userSlice";

function StudentList() {
  const dispatch = useDispatch();
  const [student, setStudent] = React.useState("");
  const token = useSelector((state) => state.auth.token);
  const users = useSelector((state) => state.user.users);

  useEffect(() => {
    dispatch(getUserList(token));
  }, []);

  console.log(student);
  console.log(users);
  return (
    <div className={styles.studentList}>
      <input onChange={(e) => setStudent(e.target.value.split(" "))} />
      {student !== "" ? (
        <div>
          {users
            .filter((user) => {
              if (student === "") {
                return null;
              } else if (
                user.first_name
                  .toLowerCase()
                  .includes(student[0].toLowerCase()) ||
                user.last_name.toLowerCase().includes(student[0].toLowerCase())
              ) {
                return user;
              } else {
                return null;
              }
            })
            .map((u) => (
              <div>
                {u.first_name} {u.last_name}
                <br />
                {u.email}
                <br />
                id: {u.id}
              </div>
            ))}
        </div>
      ) : null}
    </div>
  );
}

export default StudentList;
